import React from 'react';
import spinner from "./loadingIMG/Loader.gif";
import styles from "./Loader.module.css";

const Loader = () => {
    return (
        <div>
            <img src={spinner} alt="Loading" classNam={styles.img}/>
        </div>
    );
};

export default Loader;
